@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix atm: <http://lod.csd.auth.gr/atm/atm.ttl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

atm:BankComputerResponse
    rdf:type owl:Class ;
    owl:equivalentClass [
        rdf:type owl:Restriction ;
        owl:onProperty atm:hasResponseTime ;
        owl:hasValue 2 ;
        owl:datatype xsd:integer
    ] .

atm:Card
    rdf:type owl:Class ;
    owl:equivalentClass [
        rdf:type owl:Restriction ;
        owl:onProperty atm:hasBankComputerResponse ;
        owl:someValuesFrom [
            rdf:type owl:Restriction ;
            owl:onProperty atm:hasErrorMessage ;
            owl:someValuesFrom atm:ErrorMessage
        ]
    ] .

atm:hasResponseTime
    rdf:type owl:DatatypeProperty ;
    rdfs:domain atm:BankComputerResponse ;
    rdfs:range xsd:integer .

atm:hasBankComputerResponse
    rdf:type owl:ObjectProperty ;
    rdfs:domain atm:Card ;
    rdfs:range atm:BankComputerResponse .

atm:hasErrorMessage
    rdf:type owl:ObjectProperty ;
    rdfs:domain atm:Card ;
    rdfs:range atm:ErrorMessage .

atm:ErrorMessage
    rdf:type owl:Class .
